import { TextField, Typography, withStyles, Menu, ListItemText, MenuItem } from "@material-ui/core";
import React, { useState } from "react";

const StyledMenu = withStyles({
   paper: {
      border: '1px solid #d3d4d5',
   },
   })((props) => (
   <Menu
      elevation={0}
      getContentAnchorEl={null}
      anchorOrigin={{
         vertical: 'bottom',
         horizontal: 'center',
      }}
      transformOrigin={{
         vertical: 'top',
         horizontal: 'center',
      }}
      {...props}
   />
));

const StyledMenuItem = withStyles((theme) => ({
   root: {
      '&:focus': {
         backgroundColor: theme.palette.primary.main,
         '& .MuiListItemIcon-root, & .MuiListItemText-primary': {
            color: theme.palette.common.white,
         },
      },
   },
}))(MenuItem);

function TeamRegister(){
   const [anchorEl, setAnchorEl] = useState(null);
   const [choice, setChoice] = useState("");

   const handleClick = (event) => {
      setAnchorEl(event.currentTarget);
   };

   const handleClose = () => {
      setAnchorEl(null);
   };

   const onChoice = (event) => {
      setChoice(event.target.innerText);
      console.log(choice)
   }

   return(
      <div>
         <p>
            <b>Rules for Individuals:</b> Any student may compete as an individual 
            in their grade level or any higher grade; however, a student may 
            compete as a team at one grade level only. This applies to both 
            Championships and Masters.<br/>

            Also note each team includes four students in addition to 
            two alternates per school that can compete as individuals. So 
            when registering n teams , you get to bring 4n+2 students along. 
            These students don't need to be registered as individuals separately.
         </p>
         <div style={{width:"200px"}}>
            <TextField
               aria-controls="customized-menu"
               aria-haspopup="true"
               variant="outlined"
               color="primary"
               label="Test"
               value={choice}
               
               onClick={handleClick}
               InputProps={{
                  readOnly: true,
               }}
            >
               Click Me
            </TextField>
            <StyledMenu
               id="customized-menu"
               anchorEl={anchorEl}
               keepMounted
               open={Boolean(anchorEl)}
               onClose={handleClose}
            >
               <StyledMenuItem
                  onClick={onChoice}
               >
                  <ListItemText primary="Sent mail" />
               </StyledMenuItem>
               <StyledMenuItem
                  onClick={onChoice}
               >
                  <ListItemText primary="Drafts" />
               </StyledMenuItem>
               <StyledMenuItem
                  onClick={onChoice}
               >
                  <ListItemText primary="Inbox" />
               </StyledMenuItem>
            </StyledMenu>
         </div>
      </div>
   );
}

export default TeamRegister;
